import Button from "@material-ui/core/Button";
import ButtonProps from "~/data/ui_frameworks/material_ui/components/Button/props";
import { TComponentGroup, TProp } from "~/interfaces/material_components";

type TComponentProps = {
  [key: string]: any;
};

const mapToComponentProps = (props: TProp[]): TComponentProps => {
  return props.reduce(
    (accumulator: Record<string, any>, currentValue: TProp) => {
      if (currentValue.name === "children") return accumulator;
      accumulator[currentValue.name] = currentValue.default;
      return accumulator;
    },
    {}
  );
};

const componentGroups: TComponentGroup[] = [
  {
    iconType: "user",
    title: "Layout",
    components: [
      { title: "Box", props: [] },
      { title: "Container", props: [] },
      { title: "Grid", props: [] }
    ]
  },
  {
    iconType: "user",
    title: "Inputs",
    components: [
      {
        title: "Button",
        jsx: <Button {...mapToComponentProps(buttonProps)}>ボタン</Button>,
        props: buttonProps
      },
      { title: "Checkbox", props: [] },
      { title: "Date / Time", props: [] },
      { title: "Radio", props: [] },
      { title: "Select", props: [] },
      { title: "Slider", props: [] },
      { title: "Switch", props: [] },
      { title: "Text Field", props: [] },
      { title: "Transfer List", props: [] }
    ]
  },
  {
    iconType: "user",
    title: "Navigation",
    components: [
      { title: "Bottom Navigation", props: [] },
      { title: "Breadcrumbs", props: [] },
      { title: "Drawer", props: [] },
      { title: "Link", props: [] },
      { title: "Menu", props: [] },
      { title: "Stepper", props: [] },
      { title: "Tabs", props: [] }
    ]
  },
  {
    iconType: "user",
    title: "Surfaces",
    components: [
      { title: "App Bar", props: [] },
      {
        title: "Paper",
        props: [
          {
            name: "children",
            default: null
          },
          {
            name: "classes",
            default: null
          },
          {
            name: "component",
            default: "div"
          },
          {
            name: "elevation",
            default: 1
          },
          {
            name: "square",
            default: false
          },
          {
            name: "variant",
            default: "elevation"
          }
        ]
      },
      { title: "Card", props: [] },
      { title: "Expansion Panel", props: [] }
    ]
  },
  {
    iconType: "user",
    title: "Feedback",
    components: [
      { title: "Progress", props: [] },
      { title: "Dialog", props: [] },
      { title: "Snackbar", props: [] },
      { title: "Backdrop", props: [] }
    ]
  },
  {
    iconType: "user",
    title: "Data Display",
    components: [
      { title: "Avatar", props: [] },
      { title: "Badge", props: [] },
      { title: "Chip", props: [] },
      { title: "Divider", props: [] },
      { title: "Icons", props: [] },
      { title: "Material Icons", props: [] },
      { title: "List", props: [] },
      { title: "Table", props: [] },
      { title: "Tooltip", props: [] },
      { title: "Typography", props: [] }
    ]
  }
];

export default componentGroups;
